Deadline LIVE with Jack Blood

2010-10-27 (Wed)
---------------- 

Jack Blood's commentary on the news &amp; topics of the day in the first hour.

Hour 2 welcomes Katherine Youngblood Glass to Deadline LIVE. She is the Libertarian Candidate for Governor of Texas.
(http://www. kathie4guv .com/)

----------------

The Jack Blood Deadline LIVE moneybomb is going on now through November 12, 2010. Follow the link at the official Deadline site.
(http:// deadlinelive .info/)

----------------

